// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

interface IERC721 {
    function safeTransferFrom(
        address from,
        address to,
        uint tokenId
    ) external;

    function transferFrom(
        address,
        address,
        uint
    ) external;
}

interface IERC20 {
    function transfer(
        address,
        uint
    ) external;
}

contract Auction {
    event Start();
    event Bid(address indexed sender, uint amount);
    event Withdraw(address indexed bidder, uint amount);
    event End(address winner, uint amount);

    IERC721 public nft;
    uint public nftId;    
    address public owner;
    uint public endAt;
    bool public started;
    bool public ended;
    uint public bidStep;
    address public highestBidder;
    uint public highestBid;
    uint public price;
    uint public balance;
    mapping(address => uint[]) public bids;
    address public tokenAddress;
    uint auctionPeriod;

    constructor(
        address _nftAddress,
        uint _nftId,
        address _tokenAddress,
        uint _startingBid,
        uint _bidStep,        
        uint _auctionPeriod
    ) {
        nft = IERC721(_nftAddress);
        nftId = _nftId;
        owner = msg.sender;
        highestBid = _startingBid;
        price = _startingBid;
        bidStep = _bidStep;
        tokenAddress = _tokenAddress;
        auctionPeriod = _auctionPeriod;
    }

    function start() external {
        require(!started, "started");
        require(msg.sender == owner, "not seller");

        nft.transferFrom(msg.sender, address(this), nftId);
        started = true;
        endAt = block.timestamp + auctionPeriod;

        emit Start();
    }

    function bid(uint _value) external {
        require(started, "not started");
        require(block.timestamp < endAt, "ended");
        uint newBid = _value - (_value%bidStep);
        require(newBid > highestBid, "value < highest");

        if (highestBidder != address(0)) {
            bids[highestBidder][bids[highestBidder].length] = highestBid;
        }

        highestBidder = msg.sender;
        price = highestBid;
        highestBid = _value;

        emit Bid(msg.sender, _value);
    }

    function getBalance(address _address) private returns(uint) {
        for (uint256 index = 0; index < bids[_address].length; index++) {
            balance += bids[_address][index];
        }
        return balance;
    }

    function withdraw() external {
        if (endAt > 12 hours) {
            IERC20(tokenAddress).transfer(msg.sender, getBalance(msg.sender)); 
            emit Withdraw(msg.sender, getBalance(msg.sender));           
            for (uint256 index = 0; index < bids[msg.sender].length; index++) {
            bids[msg.sender][index] = 0;            
        }
        } else {
            IERC20(tokenAddress).transfer(msg.sender, bids[msg.sender][bids[msg.sender].length-1]);
            emit Withdraw(msg.sender, bids[msg.sender][bids[msg.sender].length-1]);
            bids[msg.sender][bids[msg.sender].length-1] = 0;            
        }
        
    }

    function end() external {
        require(started, "not started");
        require(block.timestamp >= endAt, "not ended");
        require(!ended, "ended");

        ended = true;
        uint _amount = price + bidStep;
        if (highestBidder != address(0)) {
            nft.safeTransferFrom(address(this), highestBidder, nftId);
            IERC20(tokenAddress).transfer(owner, _amount);

        } else {
            nft.safeTransferFrom(address(this), owner, nftId);
        }

        emit End(highestBidder, _amount);
    }
}
